sub_win.SubscriberWindows.FRAME_DICT = {}
with mock.patch.object(cv2, 'namedWindow'), mock.patch.object(cv2, 'imshow'
    ) as mock_imshow:
    sw = sub_win.SubscriberWindows()
    frame = np.ones((100, 100))
    sw.FRAME_DICT['0'] = frame
    sw.update_frames()
    assert sw.frames == {'0': [frame]}
    mock_imshow.assert_called_once_with('displayarray (press ESC to quit)',
        frame)
